INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 119901, 1, 0, 2.17, 1, "2023/12/22 12:00:00", 302, "2023/12/27 11:59:59", 119901, "みやこ", 0, 14, 1, "【物理】中衛で、味方をプリンで強化する幽霊聖少女。\n物理攻撃力と物理クリティカルアップのプリンパワーの\nフィールドで自分のスキルも強化し、猛攻を繰り出す。", 3, 0, 119901, "ミヤコ（クリスマス）", 119901, 1, 450, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 120001, 1, 0, 2.375, 5, "2024/03/22 12:00:00", 190, "2024/03/28 11:59:59", 120001, "しずる", 0, 6, 5, "【物理】前衛で猛攻から味方を守護する闇のお姉ちゃん。\nバトル開始時の行動不能無効スキルで周囲の味方を守り、\n範囲を束縛するスキルで敵を牽制し、戦況を一変する。", 3, 0, 120001, "シズル（ノワール）", 120001, 1, 450, 0);
